// components/DiscountMessage.js
import React from 'react';

function DiscountMessage({ onConfirm }) {
  return (
    <div className="discount-message-container">
      <h2>Congratulations! You have got 10% discount with us!</h2>
      <p>Click the button below to proceed to confirm your booking:</p>
      <button className="confirm-button" onClick={onConfirm}>
        Proceed to Confirmation
      </button>
    </div>
  );
}

export default DiscountMessage;
